class CustomMessageBox(QMessageBox):
    def __init__(self, *args, width=400, height=100, **kwargs):
        super(CustomMessageBox, self).__init__(*args, **kwargs)
        self.setStyleSheet("""
                            QMessageBox {
                                background-color: #181735;
                            }
                            QMessageBox QLabel {
                                color: yellow;
                                font-size: 14px;
                                font-family: Consolas;
                                font-weight: light;
                            }
                           """)
        self.width = width
        self.height = height
        self.setMinimumSize(self.width, self.height)
        self.setMaximumSize(self.width, self.height)

    def resizeEvent(self, event):
        super(CustomMessageBox, self).resizeEvent(event)
        self.setFixedSize(self.width, self.height)

class EncryptWorker(QObject):
    finished = pyqtSignal(str)

    def __init__(self, pText, mima):
        super().__init__()
        self.pText = pText
        self.mima = mima

    def run(self):
        tBytes = self.pText.encode('utf-8')
        tHash = SHA256.new(tBytes).digest()
        key = SHA256.new(self.mima.encode('utf-8')).digest()
        cipher = AES.new(key, AES.MODE_CBC, iv=bytes(16))
        encrypted_data = cipher.encrypt(pad(tBytes + tHash, AES.block_size))
        encrypted_text = base64.b64encode(encrypted_data).decode('utf-8')
        self.finished.emit(encrypted_text)

class DecryptWorker(QObject):
    finished = pyqtSignal(str)

    def __init__(self, b64Str, mima):
        super().__init__()
        self.b64Str = b64Str
        self.mima = mima

    def run(self):
        encrypted_data = base64.b64decode(self.b64Str)
        key = SHA256.new(self.mima.encode('utf-8')).digest()
        cipher = AES.new(key, AES.MODE_CBC, iv=bytes(16))
        try:
            decrypted_data = unpad(cipher.decrypt(encrypted_data), AES.block_size)
            tBytes = decrypted_data[:-32]
            tHash = decrypted_data[-32:]
            if SHA256.new(tBytes).digest() == tHash:
                decrypted_text = tBytes.decode('utf-8')
            else:
                decrypted_text = "Invalid Pass Phrase"
        except:
            decrypted_text = "Invalid Pass Phrase"
        self.finished.emit(decrypted_text)

class LimitedTextEdit(QTextEdit):
    def __init__(self, max_chars, *args, **kwargs):
        super().__init__(*args, **kwargs)
        self.max_chars = max_chars

    def keyPressEvent(self, event: QKeyEvent):
        if len(self.toPlainText()) >= self.max_chars and event.key() not in (Qt.Key.Key_Backspace, Qt.Key.Key_Delete):
            event.ignore()
            self.msgBox("Warning", "❌ Message too long", QMessageBox.Icon.Warning)
        else:
            super().keyPressEvent(event)

    def insertFromMimeData(self, source):
        current_text = self.toPlainText()
        new_text = source.text()
        if len(current_text) + len(new_text) > self.max_chars:
            allowed_text = new_text[:self.max_chars - len(current_text)]
            self.insertPlainText(allowed_text)
            self.msgBox("Warning", "❌ Message too long", QMessageBox.Icon.Warning)
        else:
            super().insertFromMimeData(source)

    def msgBox(self, title, message, icon):
        msg_box = CustomMessageBox()
        msg_box.setText(message)
        msg_box.setWindowTitle(title)
        msg_box.setIcon(icon)
        msg_box.exec()

class MainWindow(QMainWindow):
    OperatingSystem = platform.system()

    def __init__(self):
        super().__init__()
        self.offset = None
        self.setMouseTracking(True)
        self.initUI()

    def mousePressEvent(self, event: QMouseEvent):
        if self.OperatingSystem == "Windows":
            if event.button() == QtCore.Qt.MouseButton.LeftButton:
                self.offset = event.pos()
            else:
                super().mousePressEvent(event)
        else:
            return

    def mouseMoveEvent(self, event: QMouseEvent):
        if self.OperatingSystem == "Windows":
            try:
                if self.offset is not None and event.buttons() == QtCore.Qt.MouseButton.LeftButton:
                    self.move(self.pos() + event.pos() - self.offset)
                else:
                    super().mouseMoveEvent(event)
            except:
                pass
        else:
            return

    def mouseReleaseEvent(self, event):
        self.offset = None
        super().mouseReleaseEvent(event)

