    def setEncryptedText(self, encrypted_text):
        self.tbMessageBox.setText(encrypted_text)
        self.encrypt_thread.quit()
        self.encrypt_thread.wait()
        self.btEncrypt.setEnabled(True)

    def btEncryptClicked(self):
        if self.tbPhrase.text() == "":
            self.msgBox("Error", "⚡Passphrase Empty⚡", QMessageBox.Icon.Warning)
            return
        if self.tbMessageBox.toPlainText() == "":
            self.msgBox("Error", "⚡Nothing to Encrypt⚡", QMessageBox.Icon.Warning)
            return
        pText = self.tbMessageBox.toPlainText()
        mima  = self.tbPhrase.text()
        self.encrypt_thread = QtCore.QThread()
        self.encrypt_worker = EncryptWorker(pText, mima)
        self.encrypt_worker.moveToThread(self.encrypt_thread)
        self.encrypt_worker.finished.connect(self.setEncryptedText)
        self.encrypt_thread.started.connect(self.encrypt_worker.run)
        self.encrypt_thread.finished.connect(self.encrypt_thread.deleteLater)
        self.btEncrypt.setEnabled(False)
        self.encrypt_thread.start()

    def is_base64(self, sb):
        try:
            if isinstance(sb, str):
                sb_bytes = sb.encode('ascii')
            elif isinstance(sb, bytes):
                sb_bytes = sb
            else:
                raise ValueError("Input must be a string or bytes")
            base64.b64decode(sb_bytes, validate=True)
            return True
        except (base64.binascii.Error, ValueError):
            return False
    
    def setDecryptedText(self, decrypted_text):
        if decrypted_text == "Invalid Pass Phrase":
            self.msgBox("Error", "⚡Invalid Passphrase⚡", QMessageBox.Icon.Critical)
        elif decrypted_text == "Invalid Base64 String":
            self.msgBox("Error", "⚡Invalid Base64 String⚡", QMessageBox.Icon.Critical)
        else:
            self.tbMessageBox.setText(decrypted_text)
        self.decrypt_thread.quit()
        self.decrypt_thread.wait()
        self.btDecrypt.setEnabled(True)

    def btDecryptClicked(self):
        if self.tbPhrase.text() == "":
            self.msgBox("Error", "⚡Passphrase Empty⚡", QMessageBox.Icon.Warning)
            return
        if self.tbMessageBox.toPlainText() == "":
            self.msgBox("Error", "⚡Nothing to Decrypt⚡", QMessageBox.Icon.Warning)
            return
        if not self.is_base64(self.tbMessageBox.toPlainText()):
            self.msgBox("Error", "⚡Invalid Base64 String⚡", QMessageBox.Icon.Critical)
            return
        b64 = self.tbMessageBox.toPlainText()
        mima  = self.tbPhrase.text()
        self.decrypt_thread = QtCore.QThread()
        self.decrypt_worker = DecryptWorker(b64, mima)
        self.decrypt_worker.moveToThread(self.decrypt_thread)
        self.decrypt_worker.finished.connect(self.setDecryptedText)
        self.decrypt_thread.started.connect(self.decrypt_worker.run)
        self.decrypt_thread.finished.connect(self.decrypt_thread.deleteLater)
        self.btDecrypt.setEnabled(False)
        self.decrypt_thread.start()

